import React from "react";
import{Container, ListGroup} from "react-bootstrap";

const CoinTables = () => {
    return(
        <div>
        <Container>
            <ListGroup horizontal>
  <ListGroup.Item>Total Balance</ListGroup.Item>
  <ListGroup.Item>Available Balance</ListGroup.Item>

        </ListGroup>
        </Container>
        </div>
    );
}

export default CoinTables;
